import { Component } from 'react';
import axios from 'axios';

export class ListOfListings extends Component {

    constructor(props){
        super(props);
        this.state = {
            listings: []
        }
    }

    componentDidMount()
    {
        axios({
            method: 'get',
            url: 'https://localhost:44332/listing',
            data: {}
        }).then((response) => {
            var strs = response.data;
            var arrobjs = strs.map(str => JSON.parse(str));
            this.state.listings = arrobjs.map(arrobj => ({ ...arrobj }));
            console.log(JSON.stringify(this.state.listings[1]));
            this.render();
        })
        
    }

    render()
    {
        return (
            <ul>
                {
                    this.state.listings
                        .map((listing, index) =>
                            <li key={index}>
                                {JSON.stringify(listing), document.write(5 + 6) }
                            </li>
                        )
                }
            </ul>
            
        );
    }


}
